# [0] = current_level (starts from 0 = level 1)			0
# [1] = selected (0:start, 1:exit)				4
# [2] = player_location						8
# [3] = player_facing (0:left, 1:right)				12
# [4] = player_moving (0:stable, 1:moving)			16
# [5] = player_jump (0 no jump, 1 start jump, 16 last jump)	20
# [6] = player_dash (0 no dash, 1 dash)				24
# [7] = player_lives (0 dead, 1-2-3)				28
# [8] = player_wall (0 no_wall, 1 wall)				32
# [9] = portal_location						36
# [10] = can_dash (0 no, 1 yes)					40
# [12] = crystal_location					44
# [13] = crystal2_location					48
# [14] = crystal3_location					52
game_data:	.word	0, 0, 0x10008000, 1, 0, 0, 0, 3, 0, 0x10008000, 0, 0x10008000, 0x10008000, 0x10008000

# [0] = current time	0
# [1] = half time	4
portal_timer:	.word	9, 4

crystal_timer:	.word	0, 0, 0

player_frame:	.word	0	# (0 frame1, 1 frame2)

current_sky:	.word	0x00303199

.eqv	BASE_ADDRESS	0x10008000
.eqv	HEADER_END	0x10009C00
.eqv	MAX_ADDRESS	0x10018000

.eqv	SKY1		0x0058b8ff
.eqv	SKY2		0x00000043
.eqv	SKY3		0x0000002b
.eqv	SKY4		0x00000010

.eqv	HAIR2		0x00de16a2
.eqv	HAIR		0x00AC2B47
.eqv	SKIN		0x00EEC39A
.eqv	SHIRT		0x006ABE30
.eqv	PANTS		0x00663931

.eqv	HEART		0x00FF1100

.eqv	PORTAL		0x005b6ee1
.eqv	PORTAL1		0x00639bff
.eqv	PORTAL2		0x005fcde4

.eqv	CRYSTAL		0x00dd16a2
.eqv	CRYSTAL2	0x00de16a2
.eqv	CRYSTAL3	0x00df16a2
.eqv	WHITE		0x00ffffff

