.globl main
main:
	li $s0, BASE_ADDRESS	# first pixel in screen
	li $s1, MAX_ADDRESS	# last pixel + 1 in screen
	li $s2, HEADER_END	# last pixel+1 of header / first pixel of levels
	
	jal start_menu_set	# paint title
	jal select_set		# paint start/exit selection
	
	
	# Wait for user to input
get_menu_input:
	li $t0, 0xffff0000
	lw $t1, ($t0)
	beq $t1, 1, read_menu_input
	j get_menu_input
	
	# If W or S switch mode selected, If Enter then load level and go to next input loop
read_menu_input:
	lw $t1, 4($t0)
	beq $t1, 0x73, switch_selected
	beq $t1, 0x77, switch_selected
	beq $t1, 0x70, reset
	beq $t1, 0x0A, enter_press
	j get_menu_input
	
	
switch_selected:
	lw $t1, game_data+4
	beqz $t1, select_exit
	li $t1, 0
	j switch_chosen
	select_exit:
	li $t1, 1
	switch_chosen:
	sw $t1 game_data+4
	jal select_set
	j get_menu_input
	
	
enter_press:
	lw $t1, game_data+4
	beqz $t1, load_level
	j end
	
	
load_level:
	lw $t0, game_data+28
	beqz $t0, fail_screen_set

	j header_set
	post_header_set:
	
	li $t0, 1
	sw $t0, game_data+12	# player facing right
	sw $zero, game_data+16	# player stable
	sw $zero, game_data+20	# player not jumping
	sw $zero, game_data+24	# player not dashing
	sw $zero, game_data+32	# player not wall jumping
	sw $zero, game_data+40	# player can't dash
	
	li $t0, 9
	sw $t0, portal_timer
	li $t0, 4
	sw $t0, portal_timer+4
	
	lw $t0, game_data
	beq $t0, 0, lev_1
	beq $t0, 1, lev_2
	beq $t0, 2, lev_3
	beq $t0, 3, lev_4
	j win_screen_set
	
	lev_1:
	li $t0, SKY1
	sw $t0, current_sky
	jal level1_set
	j game_tick
	
	lev_2:
	li $t0, SKY2
	sw $t0, current_sky
	jal level2_set
	j game_tick
	
	lev_3:
	li $t0, SKY3
	sw $t0, current_sky
	jal level3_set
	j game_tick
	
	lev_4:
	li $t0, SKY4
	sw $t0, current_sky
	jal level4_set
	j game_tick
	
	
	
game_tick:
	li $t0, 0xffff0000
	lw $t1, ($t0)
	bne $t1, 1, cont_tick
	jal read_input
	cont_tick:
	
	# MAKE TICK ACTIONS HERE PLAN IN PAINT FIRST
	lw $a0, game_data+8
	jal player_unset
	
	j calc_movement
	post_calc:
	
	lw $a0, game_data+8
	jal player_set
	
	lw $a0 game_data+36
	lw $t9 portal_timer
	lw $t8 portal_timer+4
	bgt $t9, $t8 portal2
	jal portal_set1
	bnez $t9, portal_painted
	li $t9, 10
	j portal_painted
	portal2:
	jal portal_set2
	portal_painted:
	add $t9, $t9, -1
	sw $t9, portal_timer
	
	lw $a0 game_data+44
	lw $t7 crystal_timer
	beqz $t7, end_crystal_painting1
	bgt $t7, 75, spawn_crystal1
	add $t7, $t7, 1
	sw $t7, crystal_timer
	j end_crystal_painting1
	spawn_crystal1:
	sw, $zero, crystal_timer
	li $a1, CRYSTAL
	jal crystal_set
	end_crystal_painting1:
	
	lw $a0 game_data+48
	lw $t7 crystal_timer+4
	beqz $t7, end_crystal_painting2
	bgt $t7, 75, spawn_crystal2
	add $t7, $t7, 1
	sw $t7, crystal_timer+4
	j end_crystal_painting2
	spawn_crystal2:
	sw, $zero, crystal_timer+4
	li $a1, CRYSTAL2
	jal crystal_set
	end_crystal_painting2:
	
	lw $a0 game_data+52
	lw $t7 crystal_timer+8
	beqz $t7, end_crystal_painting3
	bgt $t7, 75, spawn_crystal3
	add $t7, $t7, 1
	sw $t7, crystal_timer+8
	j end_crystal_painting3
	spawn_crystal3:
	sw, $zero, crystal_timer+8
	li $a1, CRYSTAL3
	jal crystal_set
	end_crystal_painting3:
	
	li $v0, 32
	li $a0, 40
	syscall
	j game_tick
	
	
read_input:
	lw $t1, 4($t0)
	beq $t1, 0x61, set_left
	beq $t1, 0x64, set_right
	beq $t1, 0x73, set_down
	beq $t1, 0x77, set_up
	beq $t1, 0x71, set_leftdash
	beq $t1, 0x65, set_rightdash
	beq $t1, 0x70, reset
	jr $ra
	
set_left:
	sw $zero, game_data+12	# facing left
	li $t0, 1
	sw $t0, game_data+16	# moving
	jr $ra

set_right:
	li $t0, 1
	sw $t0, game_data+12	# facing right
	sw $t0, game_data+16	# moving
	jr $ra

set_down:
	sw $zero, game_data+16	# stationary
	sw $zero, game_data+32
	jr $ra

set_up:
	lw $t0, game_data+8	# get player location
	add $t0, $t0, 4608	# go to under the player
	lw $t1, 0($t0)
	beq $t1, 0x006abe30, set_jump	# check if color is ground, if yes set jump
	beq $t1, 0x00ffffff, set_jump	# check if ground
	beq $t1, 0x00daffff, set_jump	# check if ground
	lw $t1, 4($t0)
	beq $t1, 0x006abe30, set_jump	# check if color is ground, if yes set jump
	beq $t1, 0x00ffffff, set_jump	# check if ground
	beq $t1, 0x00daffff, set_jump	# check if ground
	lw $t1, 8($t0)
	beq $t1, 0x006abe30, set_jump	# check if color is ground, if yes set jump
	beq $t1, 0x00ffffff, set_jump	# check if ground
	beq $t1, 0x00daffff, set_jump	# check if ground
	lw $t1, 12($t0)
	beq $t1, 0x006abe30, set_jump	# check if color is ground, if yes set jump
	beq $t1, 0x00ffffff, set_jump	# check if ground
	beq $t1, 0x00daffff, set_jump	# check if ground
	lw $t1, 16($t0)
	beq $t1, 0x006abe30, set_jump	# check if color is ground, if yes set jump
	beq $t1, 0x00ffffff, set_jump	# check if ground
	beq $t1, 0x00daffff, set_jump	# check if ground
	lw $t1, 20($t0)
	beq $t1, 0x006abe30, set_jump	# check if color is ground, if yes set jump
	beq $t1, 0x00ffffff, set_jump	# check if ground
	beq $t1, 0x00daffff, set_jump	# check if ground
	#else check for wall jump
	lw $t0, game_data+32	# get ground_status
	bnez $t0, set_walljump	# if wall exist, set jump
	#else return
	jr $ra
	
	set_walljump:
	lw $t0, game_data+12	# player facing
	beqz $t0, set_direction_right
	sw $zero, game_data+12
	j set_jump
	set_direction_right:
	li $t0, 1
	sw $t0, game_data+12
	set_jump:
	li $t0, 1
	sw $t0, game_data+20	# start jump
	jr $ra

set_leftdash:
	lw $t0, game_data+40
	beqz $t0, skip_set_left_dash	# if no dash, don't set dash
	# else set dash
	sw $zero, game_data+12	# facing left
	li $t0, 1
	sw $zero, game_data+20	# end jump
	sw $t0, game_data+24	# start dash
	skip_set_left_dash:
	jr $ra

set_rightdash:
	lw $t0, game_data+40
	beqz $t0, skip_set_right_dash
	li $t0, 1
	sw $t0, game_data+12	# facing right
	sw $zero, game_data+20	# end jump
	sw $t0, game_data+24	# start dash
	skip_set_right_dash:
	jr $ra


calc_movement:
	lw $t0, game_data+12	# check facing direction
	bnez $t0, right_facing
	#left_facing here
	lw $t0, game_data+24	# check if dash
	bnez $t0, execute_left_dash
	#no_dash
	#check if moving
	lw $t0, game_data+16
	beqz $t0, check_jump	# if not moving skip to jump
	#else move_left (if no wall)
	lw $t0, game_data+8
	li $t1, 512
	div $t0, $t1
	mfhi $t1
	beqz $t1, check_jump	# if very left of screen, dont go and jump to jump
	
	li $t1, 1
	sw $t1, game_data+32	# set wall exists, set it to not exists if these checks dont fail
	add $t0, $t0, -4	# go left of player
	lw $t1, 0($t0)
	beq $t1, 0x006abe30, check_jump	# check if wall
	beq $t1, 0x00ffffff, check_jump	# check if wall
	beq $t1, 0x00daffff, check_jump	# check if wall
	beq $t1, 0x005b6ee1, portal_hit	# check if portal
	beq $t1, 0x00b9bab9, spike_hit	# check if spike
	blt $t1, 0x00dd16a2, skip_crystal_left1	# check if crystal
	bgt $t1, 0x00df16a2, skip_crystal_left1	# check if crystal
